import React from 'react';

type VentProps = {
    leftOnePercent: number
    leftTwoPercent: number;
    rightOnePercent: number
    rightTwoPercent: number;
};

const Vents: React.FC<VentProps> = ({ leftOnePercent, 
    leftTwoPercent, rightOnePercent, rightTwoPercent }) => {
    return (
        <div>

            <MyLineComponent/>
            <MyLineComponent/>
            <MyLineComponent/>
            <MyLineComponent/>
        </div>
    );
};

const MyLineComponent = () => {
    const lineStyle = {
      borderTop: '2px solid green', // Set the border style to create a green line
      margin: '10px 0', // Optional: Add some margin for spacing
    };

    return (
      <div style={lineStyle}>
      </div>
    );
  }


export default Vents
